(312, 21, 'картинка-2-команда', '37'),
(313, 21, '_картинка-2-команда', 'field_5c4ecaaf334a7'),
(314, 21, 'текст-2-команда', 'Pateicoties talantīgā šefpavāra bagātīgajai pieredzei, viņš strādājis dažādās Eiropas valstīs un Michelin restorānos Itālijā, Francijā un Spānijā, kā arī guvis vērtīgu pieredzi Skandināvijas valstīs, ir iespējams panākt radīto ēdienu pārsteidzošu un unikālu garšu.'),
(315, 21, '_текст-2-команда', 'field_5c4ecaca334a8'),
(316, 21, 'текст-3-команда', 'Mūsu šefpavāram ir īpaša attieksme pret produktu un dažādu garšvielu izvēli. Sagatavojot maltītes, tiek izmantoti augstas kvalitātes vietējie sezonālie gardumi, aizjūras delikateses, svaigas zivis, jūras veltes, gaļa, pašcepta maize.'),
(317, 21, '_текст-3-команда', 'field_5c4ecae5334a9'),
(318, 21, 'ссылка-команда', 'Rezervēt galdiņu'),
(319, 21, '_ссылка-команда', 'field_5c4ecaf7334aa'),
(320, 21, 'заголовок-галереи-главная', 'Ikos Olivia ir vieta, kur piedzimst<br> dzīvesprieks un garšu bauda!'),
(321, 21, '_заголовок-галереи-главная', 'field_5c4ecb404d8f6'),
(322, 95, 'заголовок_на_главном_баннере', 'Mediterranean <br>cuisine with Nordic taste accents'),
(323, 95, '_заголовок_на_главном_баннере', 'field_5c4e092b307bb'),
(324, 95, 'картинка_на_главном_баннере', '28'),
(325, 95, '_картинка_на_главном_баннере', 'field_5c4e0ac69dcf2'),
(326, 95, 'текст-1', 'Laipni lūdzam Vidusjūras restorānā pašā Rīgas centrā - Ikos Olivia. Atrodas unikālajā jūgendstila rajonā, kas iekļauts UNESCO pasaules mantojuma sarakstā. Šeit, gremdējoties Vidusjūras saulainajā atmosfērā un baudot burvīgu mūziku, un unikālus mākslas un interjera dizaina elementus, jūs aizbēgsiet no burzmas un pilsētas ritma ikdienas rūpēm.'),
(327, 95, '_текст-1', 'field_5c4e0dc8aa74f'),
(328, 95, 'изображение-1', '44'),
(329, 95, '_изображение-1', 'field_5c4e0e184d74b'),
(330, 95, 'изображение-2', '45'),
(331, 95, '_изображение-2', 'field_5c4e0e2e4d74c'),
(332, 95, 'текст-2', 'Restorāns Ikos Olivia apvieno labākās Vidusjūras reģiona valstu gastronomiskās tradīcijas un priecēs viesus un gardēžus ar neparastu itāļu, grieķu, franču un spāņu virtuves daudzveidību, pievienojot ēdieniem skandināvisku pieskaņu un papildinot to ar oriģinālu vīnu kolekciju no dažādiem reģioniem.'),
(333, 95, '_текст-2', 'field_5c4e0e5fa034c'),
(334, 95, 'ссылка-1', 'Skatit ēdienkarte'),
(335, 95, '_ссылка-1', 'field_5c4e0e69a034d'),
