(480, 99, 'текст-1', 'Laipni lūdzam Vidusjūras restorānā pašā Rīgas centrā - Ikos Olivia. Atrodas unikālajā jūgendstila rajonā, kas iekļauts UNESCO pasaules mantojuma sarakstā. Šeit, gremdējoties Vidusjūras saulainajā atmosfērā un baudot burvīgu mūziku, un unikālus mākslas un interjera dizaina elementus, jūs aizbēgsiet no burzmas un pilsētas ritma ikdienas rūpēm.'),
(481, 99, '_текст-1', 'field_5c4e0dc8aa74f'),
(482, 99, 'изображение-1', '44'),
(483, 99, '_изображение-1', 'field_5c4e0e184d74b'),
(484, 99, 'изображение-2', '45'),
(485, 99, '_изображение-2', 'field_5c4e0e2e4d74c'),
(486, 99, 'текст-2', 'Restorāns Ikos Olivia apvieno labākās Vidusjūras reģiona valstu gastronomiskās tradīcijas un priecēs viesus un gardēžus ar neparastu itāļu, grieķu, franču un spāņu virtuves daudzveidību, pievienojot ēdieniem skandināvisku pieskaņu un papildinot to ar oriģinālu vīnu kolekciju no dažādiem reģioniem.'),
(487, 99, '_текст-2', 'field_5c4e0e5fa034c'),
(488, 99, 'ссылка-1', 'Skatit ēdienkarte'),
(489, 99, '_ссылка-1', 'field_5c4e0e69a034d'),
(490, 99, 'параллакс_изображение', '46'),
(491, 99, '_параллакс_изображение', 'field_5c4ec65796d27'),
(492, 99, 'блок-2-текст', 'Uzmanīgi sagatavotie oriģinālie Vidusjūras virtuves ēdieni, neparastās garšas kombinācijas, vienmēr vērīga un kvalitatīva apkalpošana, silta, draudzīga atmosfēra ar autentiskiem Vidusjūras dekora elementiem, siltām krāsām un dabiskiem materiāliem no koka - viss rada vienreizēju pievilcību, romantisku garastāvokli un īpašu siltuma un harmonijas sajūtu.'),
(493, 99, '_блок-2-текст', 'field_5c4ec75dfe546'),
