(512, 99, 'текст-1-команда', 'Mūsu pavāru komanda, ko vada šefpavārs Aleksandrs Kardašs, veido unikālus ēdienus, prasmīgi apvienojot tradicionālo Vidusjūras un Skandināvijas virtuvi.'),
(513, 99, '_текст-1-команда', 'field_5c4eca60334a5'),
