(517, 99, '_картинка-2-команда', 'field_5c4ecaaf334a7'),
(518, 99, 'текст-2-команда', 'Pateicoties talantīgā šefpavāra bagātīgajai pieredzei, viņš strādājis dažādās Eiropas valstīs un Michelin restorānos Itālijā, Francijā un Spānijā, kā arī guvis vērtīgu pieredzi Skandināvijas valstīs, ir iespējams panākt radīto ēdienu pārsteidzošu un unikālu garšu.'),
(519, 99, '_текст-2-команда', 'field_5c4ecaca334a8'),
(520, 99, 'текст-3-команда', 'Mūsu šefpavāram ir īpaša attieksme pret produktu un dažādu garšvielu izvēli. Sagatavojot maltītes, tiek izmantoti augstas kvalitātes vietējie sezonālie gardumi, aizjūras delikateses, svaigas zivis, jūras veltes, gaļa, pašcepta maize.'),
