(805, 126, 'заголовок_на_главном_баннере', 'Mediterranean <br>cuisine with Nordic taste accents'),
(806, 126, '_заголовок_на_главном_баннере', 'field_5c4e092b307bb'),
(807, 126, 'картинка_на_главном_баннере', '28'),
(808, 126, '_картинка_на_главном_баннере', 'field_5c4e0ac69dcf2'),
(809, 126, 'текст-1', 'Laipni lūdzam Vidusjūras restorānā pašā Rīgas centrā - Ikos Olivia. Atrodas unikālajā jūgendstila rajonā, kas iekļauts UNESCO pasaules mantojuma sarakstā. Šeit, gremdējoties Vidusjūras saulainajā atmosfērā un baudot burvīgu mūziku, un unikālus mākslas un interjera dizaina elementus, jūs aizbēgsiet no burzmas un pilsētas ritma ikdienas rūpēm.'),
(810, 126, '_текст-1', 'field_5c4e0dc8aa74f'),
(811, 126, 'изображение-1', '44'),
(812, 126, '_изображение-1', 'field_5c4e0e184d74b'),
(813, 126, 'изображение-2', '45'),
(814, 126, '_изображение-2', 'field_5c4e0e2e4d74c'),
(815, 126, 'текст-2', 'Restorāns Ikos Olivia apvieno labākās Vidusjūras reģiona valstu gastronomiskās tradīcijas un priecēs viesus un gardēžus ar neparastu itāļu, grieķu, franču un spāņu virtuves daudzveidību, pievienojot ēdieniem skandināvisku pieskaņu un papildinot to ar oriģinālu vīnu kolekciju no dažādiem reģioniem.'),
(816, 126, '_текст-2', 'field_5c4e0e5fa034c'),
(817, 126, 'ссылка-1', 'Skatit ēdienkarte'),
(818, 126, '_ссылка-1', 'field_5c4e0e69a034d'),
(819, 126, 'параллакс_изображение', '46'),
(820, 126, '_параллакс_изображение', 'field_5c4ec65796d27'),
(821, 126, 'блок-2-текст', 'Uzmanīgi sagatavotie oriģinālie Vidusjūras virtuves ēdieni, neparastās garšas kombinācijas, vienmēr vērīga un kvalitatīva apkalpošana, silta, draudzīga atmosfēra ar autentiskiem Vidusjūras dekora elementiem, siltām krāsām un dabiskiem materiāliem no koka - viss rada vienreizēju pievilcību, romantisku garastāvokli un īpašu siltuma un harmonijas sajūtu.'),
(822, 126, '_блок-2-текст', 'field_5c4ec75dfe546'),
(823, 126, 'блок-2-ссылка', 'Rezervēt galdiņu'),
(824, 126, '_блок-2-ссылка', 'field_5c4ec7adfe547'),
(825, 126, 'блок-2-картинка', '47'),
(826, 126, '_блок-2-картинка', 'field_5c4ec7c5fe548'),
(827, 126, 'блок-2-картинка-2', '48'),
(828, 126, '_блок-2-картинка-2', 'field_5c4ec801fe549'),
(829, 126, 'баннер_бара', '38'),
(830, 126, '_баннер_бара', 'field_5c4ec86703979'),
(831, 126, 'текст-бар-1', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed aliquet tristique ex, a auctor nunc iaculis in. Donec et posuere nibh. Vivamus elit turpis, congue id nibh pharetra, semper eleifend nibh. In sed fringilla nulla. Cras ornare molestie ligula, fermentum ultrices massa placerat non. Cras vel volutpat libero.'),
(832, 126, '_текст-бар-1', 'field_5c4ec88d0397a'),
(833, 126, 'изображение-1-бар', '49'),
(834, 126, '_изображение-1-бар', 'field_5c4ec8a70397b'),
(835, 126, 'изображение-2-бар', '50'),
(836, 126, '_изображение-2-бар', 'field_5c4ec8d20397c'),
(837, 126, 'текст-2-бар', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed aliquet tristique ex, a auctor nunc iaculis in. Donec et posuere nibh. Vivamus elit turpis, congue id nibh pharetra, semper eleifend nibh. In sed fringilla nulla. Cras ornare molestie ligula, fermentum ultrices massa placerat non. Cras vel volutpat libero.'),
(838, 126, '_текст-2-бар', 'field_5c4ec8ef0397d'),
(839, 126, 'баннер-команда', '52'),
(840, 126, '_баннер-команда', 'field_5c4eca02334a4'),
(841, 126, 'текст-1-команда', 'Mūsu pavāru komanda, ko vada šefpavārs Aleksandrs Kardašs, veido unikālus ēdienus, prasmīgi apvienojot tradicionālo Vidusjūras un Skandināvijas virtuvi.'),
(842, 126, '_текст-1-команда', 'field_5c4eca60334a5'),
(843, 126, 'картинка-1-команда', '37'),
(844, 126, '_картинка-1-команда', 'field_5c4eca90334a6'),
(845, 126, 'картинка-2-команда', '37'),
(846, 126, '_картинка-2-команда', 'field_5c4ecaaf334a7'),
(847, 126, 'текст-2-команда', 'Pateicoties talantīgā šefpavāra bagātīgajai pieredzei, viņš strādājis dažādās Eiropas valstīs un Michelin restorānos Itālijā, Francijā un Spānijā, kā arī guvis vērtīgu pieredzi Skandināvijas valstīs, ir iespējams panākt radīto ēdienu pārsteidzošu un unikālu garšu.'),
(848, 126, '_текст-2-команда', 'field_5c4ecaca334a8'),
(849, 126, 'текст-3-команда', 'Mūsu šefpavāram ir īpaša attieksme pret produktu un dažādu garšvielu izvēli. Sagatavojot maltītes, tiek izmantoti augstas kvalitātes vietējie sezonālie gardumi, aizjūras delikateses, svaigas zivis, jūras veltes, gaļa, pašcepta maize.'),
(850, 126, '_текст-3-команда', 'field_5c4ecae5334a9'),
(851, 126, 'ссылка-команда', 'Rezervēt galdiņu'),
(852, 126, '_ссылка-команда', 'field_5c4ecaf7334aa'),
(853, 126, 'заголовок-галереи-главная', 'Ikos Olivia ir vieta, kur piedzimst<br> dzīvesprieks un garšu bauda!'),
