(1697, 218, '_картинка_на_главном_баннере', 'field_5c4e0ac69dcf2'),
(1698, 218, 'текст-1', 'Laipni lūdzam Vidusjūras restorānā pašā Rīgas centrā - Ikos Olivia. Atrodas unikālajā jūgendstila rajonā, kas iekļauts UNESCO pasaules mantojuma sarakstā. Šeit, gremdējoties Vidusjūras saulainajā atmosfērā un baudot burvīgu mūziku, un unikālus mākslas un interjera dizaina elementus, jūs aizbēgsiet no burzmas un pilsētas ritma ikdienas rūpēm.'),
(1699, 218, '_текст-1', 'field_5c4e0dc8aa74f'),
(1700, 218, 'изображение-1', '44'),
(1701, 218, '_изображение-1', 'field_5c4e0e184d74b'),
(1702, 218, 'изображение-2', '45'),
(1703, 218, '_изображение-2', 'field_5c4e0e2e4d74c'),
(1704, 218, 'текст-2', 'Restorāns Ikos Olivia apvieno labākās Vidusjūras reģiona valstu gastronomiskās tradīcijas un priecēs viesus un gardēžus ar neparastu itāļu, grieķu, franču un spāņu virtuves daudzveidību, pievienojot ēdieniem skandināvisku pieskaņu un papildinot to ar oriģinālu vīnu kolekciju no dažādiem reģioniem.'),
(1705, 218, '_текст-2', 'field_5c4e0e5fa034c'),
(1706, 218, 'ссылка-1', 'Skatit ēdienkarte'),
(1707, 218, '_ссылка-1', 'field_5c4e0e69a034d'),
(1708, 218, 'параллакс_изображение', '46'),
(1709, 218, '_параллакс_изображение', 'field_5c4ec65796d27'),
(1710, 218, 'блок-2-текст', 'Uzmanīgi sagatavotie oriģinālie Vidusjūras virtuves ēdieni, neparastās garšas kombinācijas, vienmēr vērīga un kvalitatīva apkalpošana, silta, draudzīga atmosfēra ar autentiskiem Vidusjūras dekora elementiem, siltām krāsām un dabiskiem materiāliem no koka - viss rada vienreizēju pievilcību, romantisku garastāvokli un īpašu siltuma un harmonijas sajūtu.'),
(1711, 218, '_блок-2-текст', 'field_5c4ec75dfe546'),
(1712, 218, 'блок-2-ссылка', 'Rezervēt galdiņu'),
