(1729, 218, '_баннер-команда', 'field_5c4eca02334a4'),
(1730, 218, 'текст-1-команда', 'Mūsu pavāru komanda, ko vada šefpavārs Aleksandrs Kardašs, veido unikālus ēdienus, prasmīgi apvienojot tradicionālo Vidusjūras un Skandināvijas virtuvi.'),
