(1733, 218, '_картинка-1-команда', 'field_5c4eca90334a6'),
(1734, 218, 'картинка-2-команда', '37'),
(1735, 218, '_картинка-2-команда', 'field_5c4ecaaf334a7'),
(1736, 218, 'текст-2-команда', 'Pateicoties talantīgā šefpavāra bagātīgajai pieredzei, viņš strādājis dažādās Eiropas valstīs un Michelin restorānos Itālijā, Francijā un Spānijā, kā arī guvis vērtīgu pieredzi Skandināvijas valstīs, ir iespējams panākt radīto ēdienu pārsteidzošu un unikālu garšu.'),
(1737, 218, '_текст-2-команда', 'field_5c4ecaca334a8'),
(1738, 218, 'текст-3-команда', 'Mūsu šefpavāram ir īpaša attieksme pret produktu un dažādu garšvielu izvēli. Sagatavojot maltītes, tiek izmantoti augstas kvalitātes vietējie sezonālie gardumi, aizjūras delikateses, svaigas zivis, jūras veltes, gaļa, pašcepta maize.'),
