(1797, 219, '_текст-2-команда', 'field_5c4ecaca334a8'),
(1798, 219, 'текст-3-команда', 'Mūsu šefpavāram ir īpaša attieksme pret produktu un dažādu garšvielu izvēli. Sagatavojot maltītes, tiek izmantoti augstas kvalitātes vietējie sezonālie gardumi, aizjūras delikateses, svaigas zivis, jūras veltes, gaļa, pašcepta maize.'),
